          <span>Employee Name</span>
          <span
            style={styles.logout}
            onMouseOver={(e) => (e.target.style.color = "darkred")}
            onMouseOut={(e) => (e.target.style.color = "red")}
          >
            Logout
          </span>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: "flex",
    width: "170vh",
    height: "100vh",
    fontFamily: "'Poppins', sans-serif",
    margin: 0,
    padding: 0,
    backgroundColor: "#f4f4f4",
  },
  sidebar: {
    width: "250px",
    backgroundColor: "#121212",
    color: "white",
    display: "flex",
    flexDirection: "column",
    padding: "20px",
  },
  sidebarTitle: {
    fontSize: "24px",
    marginBottom: "30px",
  },
  menu: {
    display: "flex",
    flexDirection: "column",
    gap: "15px",
